import React,{Component} from 'react';
import {Tabs,Tab , Grid ,Cell , Card , CardTitle , CardActions ,Button , CardMenu, IconButton,CardText } from 'react-mdl';

class Projects extends Component{
    constructor(props){
        super(props);
        this.state = {activeTab : 0 } ;
    }


    toggleCategories = () => {
        if(this.state.activeTab === 0 ){
            return(
                <div  className='projects-grid'>
                    <Card shadow={5} style={{minWidth:'450',margin:'auto'}}>
                        <CardTitle style ={{color:'black' , height : '176px' , background: 'url(https://images.loksatta.com/2020/01/Joke-Marathi-2.jpg) center / cover'}}>Joke Generator</CardTitle>
                        <CardText>
                            This is my First Project which can directly generate some good Jokes to make you feel better.
                        </CardText>
                        <CardActions border>
                        <a href="https://github.com/ch-shubham/joke-generator" rel="noopener noreferrer" target="_blank">
                            <Button colored> Github </Button>
                        </a>
                        <a href="https://shubhamjokers.web.app/" rel="noopener noreferrer" target="_blank">
                            <Button colored> Live Demo </Button>
                        </a>
                        </CardActions>
                        <CardMenu style={{color:'#fff'}}>
                            <IconButton name='share' />
                        </CardMenu>
                    </Card>

                    <Card shadow={5} style={{minWidth:'450',margin:'auto'}}>
                        <CardTitle style ={{color:'#fff' , height : '176px' , background: 'url(https://cdn.evilmartians.com/front/posts/optimizing-react-virtual-dom-explained/cover-a1d5b40.png) center / cover'}}>React project #1</CardTitle>
                        <CardText>
                            This is my First React Project.This is my First React Project.This is my First React Project.
                        </CardText>
                        <CardActions border>
                            <Button colored> Github </Button>
                            <Button colored> CodePen </Button>
                            <Button colored> Live Demo </Button>
                        </CardActions>
                        <CardMenu style={{color:'#fff'}}>
                            <IconButton name='share' />
                        </CardMenu>
                    </Card>

                    <Card shadow={5} style={{minWidth:'450',margin:'auto'}}>
                        <CardTitle style ={{color:'#fff' , height : '176px' , background: 'url(https://cdn.evilmartians.com/front/posts/optimizing-react-virtual-dom-explained/cover-a1d5b40.png) center / cover'}}>React project #1</CardTitle>
                        <CardText>
                            This is my First React Project.This is my First React Project.This is my First React Project.
                        </CardText>
                        <CardActions border>
                            <Button colored> Github </Button>
                            <Button colored> CodePen </Button>
                            <Button colored> Live Demo </Button>
                        </CardActions>
                        <CardMenu style={{color:'#fff'}}>
                            <IconButton name='share' />
                        </CardMenu>
                    </Card>
                </div>
            );
        }

        else if(this.state.activeTab === 1 ){
            return(
                <div>Angular</div>
            );
        }
        else if(this.state.activeTab === 2 ){
            return(
                <div>Mongodb</div>
            );
        }
        else if(this.state.activeTab === 3 ){
            return(
                <div>Nodejs</div>
            );
        }
}
    render(){
        return(
            <div className="category-tabs">
                 <h1 style={{textAlign:'center'}}>My Projects</h1>
                 <hr></hr>
                 <Grid>
                        <Cell col={12}>
                            <div className="content">{this.toggleCategories()}</div>
                        </Cell>
                 </Grid>

            </div>
        );
    }
}

export default Projects;
